    // ))

    return (
        <table className="table">
            <thead>
                <tr>
                    <th>Name</th>
                    <th>Difficulty</th>
                    <th>Priority</th>
                    <th>End Date</th>
                    <th>Complete</th>
                </tr>
            </thead>
            <tbody>
                    <Tasks taskInfo={props}/>
            </tbody>
        </table>
    )
}
